import React from 'react'
import { Grid, Image } from 'semantic-ui-react'

const ChampionCard = (props) => {
  return(
    <Grid.Column style={{fontSize: '13px'}}>
      <Image src={props.champion.icon_image} />
      {props.champion.name}, 
    </Grid.Column>
  )
}

export default ChampionCard
